const inputData = $input.all().map(i => i.json);

// Step 1: Group data by Competitor Name and Platform
const groupedData = {};

for (const post of inputData) {
  const competitor = post["Competitor Name"];
  const platform = post["Platform"];

  if (!groupedData[competitor]) {
    groupedData[competitor] = {};
  }

  if (!groupedData[competitor][platform]) {
    groupedData[competitor][platform] = [];
  }

  groupedData[competitor][platform].push(post);
}

// Step 2: Sort each platform array by Date (descending)
for (const competitor in groupedData) {
  for (const platform in groupedData[competitor]) {
    groupedData[competitor][platform].sort((a, b) => {
      const dateA = new Date(a.Date);
      const dateB = new Date(b.Date);
      return dateB - dateA; // Newest first
    });
  }
}

// Step 3: Return the structured grouped data
return [
  {
    json: groupedData
  }
];

// Get the first (and only) item from input
